import React from "react";
import sliderAntonieta from "./fotos";
// Import Swiper React components
import { Swiper, SwiperSlide } from "swiper/react";
// Import Swiper styles
import "swiper/swiper.min.css";
import "swiper/components/effect-cube/effect-cube.min.css";
import "swiper/components/pagination/pagination.min.css";
import "swiper/components/navigation/navigation.min.css";
import SwiperCore, { EffectCube, Pagination } from "swiper";
SwiperCore.use([EffectCube, Pagination]);

//import "./styles"
//

export default function Antonieta() {

  return (
    <div className='divComponente'>
      <h2>Antonieta</h2>
      <h3>Desliza para mas imagenes</h3>
      <section>
        <Swiper
        effect={"cube"}
        grabCursor={true}
        cubeEffect={{
          shadow: true,
          slideShadows: true,
          shadowOffset: 20,
          shadowScale: 0.94,
        }}

        pagination={true}
        className="mySwiper"
        >

        {sliderAntonieta.map((item, index) => {
          return (
            <div

            >
              {<SwiperSlide className='swiperStore'><img src={item} alt='slider' className="image"></img></SwiperSlide>}
            </div>
          );
        })}
        </Swiper>
      </section>
    </div>
  );
}
